import React from 'react';

function RoundedTextBox(props) {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <p>Hello</p>
      <input
        type="text"
        style={{
          borderRadius: '5px',
          padding: '10px',
          border: '1px solid gray',
        }}
        {...props}
      />
    </div>
  );
}

function App(){
  return (
    <div>
      <RoundedTextBox placeholder="Insert text"/>
    </div>
  );
}

export default App;
